// src/App.js (Modified to remove authentication logic)
import React, { useState } from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import ProjectPage from "./components/ProjectPage";
import EditorPage from "./components/EditorPage";

const App = () => {
  const [project, setProject] = useState(null);

  return (
    <Router>
      <Switch>
        <Route exact path="/" component={() => <ProjectPage setProject={setProject} />} />
        <Route exact path="/editor" component={() => <EditorPage project={project} />} />
      </Switch>
    </Router>
  );
};

export default App;
